การโหลดข้อมูลแผนที่ล้มเหลว ใช้ข้อมูลแคชท้องถิ่น ไม่พบแผนที่ที่ใช้ได้ กรุณาตรวจสอบ:
1. การเชื่อมต่อเครือข่ายปกติหรือไม่;
2. การตั้งชื่อแผนที่ถูกต้องหรือไม่;
3. มีการกำหนดจุดสำหรับการใช้ลิฟต์หรือไม่;
4. แผนที่มีจุดและเส้นทางที่ใช้ได้หรือไม่;

โหลดข้อมูลแผนที่สำเร็จ แต่ไม่พบแผนที่ที่ใช้ได้ กรุณาตรวจสอบ:
1. การตั้งชื่อแผนที่ถูกต้องหรือไม่;
2. มีการกำหนดจุดสำหรับการใช้ลิฟต์หรือไม่;
3. แผนที่มีจุดและเส้นทางที่ใช้ได้หรือไม่;
